    true,nt"url": null,nt"notes": "<p>The Mortality - Multiple Cause of Death
    data on CDC WONDER are county-level national mortality and population data spanning
    the years 1999-2006. These data are available in two separate data sets: one data
    set for years 1999-2004 with 3 race groups, and another data set for years 2005-2006
    with 4 race groups and 3 Hispanic origin categories. Data are based on death certificates
    for U.S. residents. Each death certificate contains a single underlying cause of
    death, up to twenty additional multiple causes, and demographic data. The number
    of deaths, crude death rates,  age-adjusted death rates, standard errors and 95%
    confidence intervals for death rates can be obtained by place of residence (total
    U.S., state, and county), age group (including infants), race, Hispanic ethnicity
    (years 2005-2006 only), gender, year of death, and cause-of-death (4-digit ICD-10
    code or group of codes). The data are produced by the National Center for Health
    Statistics.</p>n",nt"license_title": "Other License Specified",nt"extras":
